import React from 'react';

import {Section, Container, Wrap, Content, Image} from './HomeElements';
import homepage from '../../images/homepage.jpg';

const Home = () => {
    return (
        <Section>
            <Container>
                <Wrap>
                    <Content>
                        <h1>Hello</h1>
                        <p>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Accusantium deleniti nostrum distinctio laborum consequuntur, possimus fugit. Perferendis assumenda accusantium porro!</p>
                    </Content>
                    <Image src={homepage} alt='snowy mountains'/>
                </Wrap>
            </Container>

        </Section>
    );
};

export default Home;
